		mirror.onload = function(){
			ctx.save();
			ctx.drawImage(mirror, 250, 280, 70, 106);
			ctx.globalCompositeOperation = 'destination-out';
			ctx.beginPath();
			ctx.moveTo(320,300);
			ctx.lineTo(259,335);
			ctx.lineTo(259,390);
			ctx.lineTo(320,390);
			ctx.closePath();
			ctx.fill();
			ctx.restore();
		};
		
		function fadeMirror(){
			ctx.save();
			if (alphaMirror <= 0){
				return;
			};         
			window.requestAnimFrame(fadeMirror);
			ctx.clearRect(250, 280, 70, 106);
			ctx.globalAlpha = alphaMirror;
			ctx.drawImage(mirror, 250, 280, 70, 106);
			alphaMirror += -0.01;
			ctx.restore();
		};

		var MirrorStartX = 355;
		var MirrorStartY = 718;
		var MirrorEndX = 460;
		var MirrorEndY = 718;
		function crossMirror(){
			setInterval(function(){
				ctx.save();
				amountMirror += 0.05;
				if (amountMirror > 1) amountMirror = 1;
				ctx.strokeStyle = "#460000";
				ctx.beginPath();
				ctx.moveTo(MirrorStartX, MirrorStartY);
				ctx.lineTo(MirrorStartX + (MirrorEndX - MirrorStartX) * amountMirror, MirrorStartY + (MirrorEndY - MirrorStartY) * amountMirror);
				ctx.stroke();
				ctx.closePath();
				ctx.restore();
			}, 30);
		};
		
		var continueAnimating = true;
		function hintMirror(){
			ctx2.save();
			if(!continueAnimating){return;}
			window.requestAnimFrame(hintMirror);
			shineMirror += 5;
			if (shineMirror > 500) shineMirror = 0;
			ctx2.clearRect(0,0,canvas2.width,canvas2.height);
			ctx2.beginPath();
			ctx2.arc(283, 305, 30, 0, 2 * Math.PI);
			ctx2.strokeStyle="yellow";
			ctx2.shadowBlur=shineMirror;
			ctx2.shadowColor="yellow";
			ctx2.lineWidth = 3;
			ctx2.stroke();
			ctx2.closePath();
			clearTimeout(timeoutMirror);
			ctx2.restore();
		};
		
		function clearMirror(){
			ctx2.save();
			ctx2.clearRect(240, 260, 95, 95);
			ctx2.restore();
		};

		function fadeBallerina(){
			ctx.save();

			ctx.clearRect(723, 310, 83, 136);

				ctx.strokeStyle = "#460000";
				ctx.beginPath();

				ctx.closePath();
				ctx.restore();
			}, 30);
		};

				ctx2.closePath();
				clearTimeout(timeoutBallerina);

		function fadeParfume(){
			ctx.save();
			if (alphaParfume <= 0){
				return;
			};         
			window.requestAnimFrame(fadeParfume);
			ctx.clearRect(374, 475, 73, 76);
			ctx.globalAlpha = alphaParfume;
			ctx.translate(376, 475);
			ctx.translate(30,38);
			ctx.rotate(0.4);
			ctx.drawImage(parfume, -30, -38, 60, 76);
			alphaParfume += -0.01;
			ctx.restore();
		};

		var fadeAnimating3 = false;
		function crossParfume(){
			setInterval(function(){
				ctx.save();
				fadeAnimating3 = true;
				amountParfume += 0.05;
				if (amountParfume > 1) amountParfume = 1;
				ctx.strokeStyle = "#460000";
				ctx.beginPath();
				ctx.moveTo(ParfumeStartX, ParfumeStartY);
				ctx.lineTo(ParfumeStartX + (ParfumeEndX - ParfumeStartX) * amountParfume, ParfumeStartY + (ParfumeEndY - ParfumeStartY) * amountParfume);
				ctx.stroke();
				ctx.closePath();
				ctx.restore();
			}, 30);
		};
		
		var continueAnimating3 = false;

				shineParfume += 5;
				if (shineParfume > 500) shineParfume = 0;
				ctx2.clearRect(0,0,canvas2.width,canvas2.height);
				ctx2.beginPath();
				ctx2.arc(400, 500, 30, 0, 2 * Math.PI);
				ctx2.strokeStyle="yellow";
				ctx2.shadowBlur=shineParfume;
				ctx2.shadowColor="yellow";
				ctx2.lineWidth = 3;
				ctx2.stroke();
				ctx2.closePath();
				clearTimeout(timeoutParfume);
				ctx2.restore();
			}
		};

		comb.onload = function(){
			ctx.save();
			ctx.translate(1180, 363);
			ctx.translate(25,24.5);
			ctx.rotate(0.6);
			ctx.drawImage(comb, -25, -24.5, 50, 49);
			ctx.restore();
			ctx.save();
			ctx.globalCompositeOperation = 'destination-out';
			ctx.beginPath();
			ctx.moveTo(1193,350);
			ctx.lineTo(1200,362);
			ctx.lineTo(1203,394);
			ctx.lineTo(1218,390);
			ctx.lineTo(1225,385);
			ctx.lineTo(1218,425);
			ctx.lineTo(1230,425);
			ctx.lineTo(1238,375);
			ctx.closePath();
			ctx.fill();
			ctx.restore();
		};
		
		function fadeComb(){
			ctx.save();
			if (alphaComb <= 0){
				return;
			};         
			window.requestAnimFrame(fadeComb);
			ctx.clearRect(1170, 350, 67, 73);
			ctx.globalAlpha = alphaComb;
			ctx.translate(1180, 363);
			ctx.translate(25,24.5);
			ctx.rotate(0.6);
			ctx.drawImage(comb, -25, -24.5, 50, 49);
			alphaComb += -0.01;
			ctx.restore();
		};
		
		var CombStartX = 915;
		var CombStartY = 718;
		var CombEndX = 1010;
		var CombEndY = 718;
		var fadeAnimating4 = false;
		function crossComb(){
			setInterval(function(){
				ctx.save();
				fadeAnimating4 = true;
				amountComb += 0.05;
				if (amountComb > 1) amountComb = 1;
				ctx.strokeStyle = "#460000";
				ctx.beginPath();
				ctx.moveTo(CombStartX, CombStartY);
				ctx.lineTo(CombStartX + (CombEndX - CombStartX) * amountComb, CombStartY + (CombEndY - CombStartY) * amountComb);
				ctx.stroke();
				ctx.closePath();
				ctx.restore();
			}, 30);
		};
		
		var continueAnimating4 = false;
		function hintComb(){
			ctx2.save();
			if(!continueAnimating4){return;}
			if(continueAnimating4){
				window.requestAnimFrame(hintComb);
				shineComb += 5;
				if (shineComb > 500) shineComb = 0;
				ctx2.clearRect(0,0,canvas2.width,canvas2.height);
				ctx2.beginPath();
				ctx2.arc(1201, 390, 30, 0, 2 * Math.PI);
				ctx2.strokeStyle="yellow";
				ctx2.shadowBlur=shineComb;
				ctx2.shadowColor="yellow";
				ctx2.lineWidth = 3;
				ctx2.stroke();
				ctx2.closePath();
				clearTimeout(timeoutComb);
				ctx2.restore();
			}
		};
		
		function clearComb(){
			ctx2.save();
			ctx2.clearRect(1155, 348, 95, 100);
			ctx2.restore();
		};
		
		canvas3.addEventListener('mousemove', light, false);
		var timeoutMirror,
			timeoutParfume,
			timeoutBallerina,
			timeoutComb;
			
		function light(){
			clearTimeout(timeoutMirror);
			timeoutMirror = setTimeout(hintMirror, 5000);
			clearTimeout(timeoutBallerina);
			timeoutBallerina = setTimeout(hintBallerina, 5000);
			clearTimeout(timeoutParfume);
			timeoutParfume = setTimeout(hintParfume, 5000);
			clearTimeout(timeoutComb);
			timeoutComb = setTimeout(hintComb, 5000);
		};
		
		document.getElementById("mirror").addEventListener('mousedown', onMirror, false);
		function onMirror(){
			window.requestAnimFrame(fadeMirror);
			window.requestAnimFrame(crossMirror);
			continueAnimating = false;
			if (fadeAnimating2 && fadeAnimating3 && fadeAnimating4){
				continueAnimating = false;
			} else if (fadeAnimating2 && fadeAnimating3){
				continueAnimating4 = true;
			} else if(fadeAnimating2){
				continueAnimating3 = true;
			} else {
				continueAnimating2 = true;
			}
			clearMirror();
		};
		document.getElementById("ballerina").addEventListener('mousedown', onBallerina, false);
		function onBallerina(){
			window.requestAnimFrame(fadeBallerina);
			window.requestAnimFrame(crossBallerina);
			continueAnimating2 = false;
			if (continueAnimating){
				continueAnimating2 = false;
			} else if(!continueAnimating && fadeAnimating3 && fadeAnimating4){
				continueAnimating2 = false;
			} else if (!continueAnimating && fadeAnimating3){
				continueAnimating4 = true;
			} else if (!continueAnimating && fadeAnimating4){
				continueAnimating3 = true;
			} else {
				continueAnimating3 = true;
			}
			clearBallerina();
		};
		document.getElementById("parfume").addEventListener('mousedown', onParfume, false);
		function onParfume(){
			window.requestAnimFrame(fadeParfume);
			window.requestAnimFrame(crossParfume);
			continueAnimating3 = false;
			if (continueAnimating){
				continueAnimating3 = false;
			} else if (!continueAnimating && fadeAnimating2 && fadeAnimating4){
				continueAnimating3 = false;
			} else if (!continueAnimating && fadeAnimating2){
				continueAnimating4 = true;
			} else if (!continueAnimating && fadeAnimating4){
				continueAnimating2 = true;
			} else if (!continueAnimating){
				continueAnimating2 = true;
			} else {
				continueAnimating4 = true;
			}
			clearParfume();
		};
		
		document.getElementById("comb").addEventListener('mousedown', onComb, false);
		function onComb(){
			window.requestAnimFrame(fadeComb);
			window.requestAnimFrame(crossComb);
			continueAnimating4 = false;
			if (continueAnimating){
				continueAnimating4 = false;
			} else if (!continueAnimating && fadeAnimating2 && fadeAnimating3){
				continueAnimating4 = false;
			} else if (!continueAnimating && fadeAnimating2){
				continueAnimating3 = true;
			} else if (!continueAnimating && fadeAnimating3){
				continueAnimating2 = true;
			}
			clearComb();
		};
		
		function end(){
			setInterval(function(){
				var timeoutScreen;
				if (!continueAnimating && fadeAnimating2 && fadeAnimating3 && fadeAnimating4){
					timeoutScreen = setTimeout(changeScreen, 2000);
				}
			}, 10);
		};
		end();
		
		function changeScreen(){
			document.getElementById("mirror").style.display = "none";
			document.getElementById("parfume").style.display = "none";
			document.getElementById("ballerina").style.display = "none";
			document.getElementById("comb").style.display = "none";
			document.getElementById("canvas2").style.display = "none";
			document.getElementById("canvas3").style.display = "none";
			document.getElementById("canvas4").style.display = "block";
			document.getElementById("playfree").style.display = "block";
		};
